import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Data_Admin = () => {
  const [books, setBooks] = useState([]);
  const [authors, setAuthors] = useState([]);
  const [editingAuthor, setEditingAuthor] = useState(null);
  const [editingBook, setEditingBook] = useState(null);

  useEffect(() => {
    fetchBooks();
    fetchAuthors();
  }, []);

  const fetchBooks = () => {
    axios.get('http://localhost:8000/api/books')
      .then(response => {
        setBooks(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  };

  const fetchAuthors = () => {
    axios.get('http://localhost:8000/api/authors')
      .then(response => {
        setAuthors(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  };

  const handleAuthorInputChange = (e) => {
    setEditingAuthor({ ...editingAuthor, [e.target.name]: e.target.value });
  };

  const handleBookInputChange = (e) => {
    setEditingBook({ ...editingBook, [e.target.name]: e.target.value });
  };

  const updateAuthor = () => {
    axios.put(`http://localhost:8000/api/authors/${editingAuthor._id}`, editingAuthor)
      .then(response => {
        setEditingAuthor(null);
        fetchAuthors();
      })
      .catch(error => {
        console.error(error);
      });
  };

  const updateBook = () => {
    axios.put(`http://localhost:8000/api/books/${editingBook._id}`, editingBook)
      .then(response => {
        setEditingBook(null);
        fetchBooks();
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <div>
      <h1>Data Admin</h1>

      <h2>Authors</h2>
      <ul>
        {authors.map(author => (
          <li key={author._id}>
            {editingAuthor && editingAuthor._id === author._id ? (
              <>
                <input
                  type="text"
                  name="firstname"
                  value={editingAuthor.firstname}
                  onChange={handleAuthorInputChange}
                />
                <input
                  type="text"
                  name="lastname"
                  value={editingAuthor.lastname}
                  onChange={handleAuthorInputChange}
                />
                <input
                  type="text"
                  name="dateofbirth"
                  value={editingAuthor.dateofbirth}
                  onChange={handleAuthorInputChange}
                />
                <button onClick={updateAuthor}>Save</button>
                <button onClick={() => setEditingAuthor(null)}>Cancel</button>
              </>
            ) : (
              <>
                {author.firstname} {author.lastname} ({author.dateofbirth})
                <button onClick={() => setEditingAuthor(author)}>Edit</button>
              </>
            )}
          </li>
        ))}
      </ul>

      <h2>Books</h2>
      <ul>
        {books.map(book => (
          <li key={book._id}>
            {editingBook && editingBook._id === book._id ? (
              <>
                <input
                  type="text"
                  name="title"
                  value={editingBook.title}
                  onChange={handleBookInputChange}
                />
                <input
                  type="text"
                  name="price"
                  value={editingBook.price}
                  onChange={handleBookInputChange}
                />
                <button onClick={updateBook}>Save</button>
                <button onClick={() => setEditingBook(null)}>Cancel</button>
              </>
            ) : (
              <>
                {book.title} / {book.author.firstname} {book.author.lastname} / {book.author.dateofbirth} / {book.price}
                <button onClick={() => setEditingBook(book)}>Edit</button>
              </>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Data_Admin;
